import React from "react";
import logo from "../../assets/Logo-w.png"
import "./pinknav.css"
import ButtonBasic from "../Buttons/button";
import {Link} from "react-router-dom";
import {AuthContextTest} from "../../context/AuthContext--test";
import {useContext} from "@types/react";

function Pinknavbutton({title}) {
    const { logout} = useContext(AuthContextTest);
    return (
        <div className='pink-nav'>
            <h1> {title} </h1>
            <img className='foto-container' src={logo} alt="Logo D&B"/>

            <Link to="/bestellijst">
                <ButtonBasic
                    title="Nieuw project">
                </ButtonBasic>

            </Link>

            <ButtonBasic
                title="Uitloggen"
            onClick = {logout}>
            </ButtonBasic>
        </div>


    )
}

export default Pinknavbutton;
